import React from 'react';
import { NAV } from '../../router/url';
import { Link } from 'react-router-dom';

function FooterNav () {

    function renderNavItem (item) {
        return (
            <li class="nav-item active" key = {item.u}>
              <Link Link a class="nav-link" to ={item.url}>{item.title}</Link>
            </li>
        )
    }

    return (
        <nav class="navbar navbar-expand-lg justify-content-end">
                                    <button class="navbar-toggler collapsed" type="button" data-toggle="collapse" 
                                        data-target="#footerNavContent" aria-controls="footerNavContent" aria-expanded="false" 
                                        aria-label="Toggle navigation"><i class="fa fa-bars"/></button>
                                    <div class="navbar-collapse collapse" id="footerNavContent">
                                        <ul class="navbar-nav ml-auto">
                                            <li class="nav-item active">
                                                <a class="nav-link" href="index.html">Home</a>
                                            </li>
                                            <li class="nav-item">
                                                <a class="nav-link" href="shop.html">Shop</a>
                                            </li>
                                            <li class="nav-item">
                                                <a class="nav-link" href="product-details.html">Product</a>
                                            </li>
                                            <li class="nav-item">
                                                <a class="nav-link" href="cart.html">Cart</a>
                                            </li>
                                            <li class="nav-item">
                                                <a class="nav-link" href="checkout.html">Checkout</a>
                                            </li>
                                        </ul>
                                    </div>
                                </nav>
    )
}

export default React.memo(FooterNav);
